import React from 'react';
import './Skills.css';

const skillCategories = {
  "Languages": ["Python", "Java", "JavaScript", "C#", "SQL"],
  "Web Development": ["React.js", "Node.js", "Express.js", "HTML", "CSS", "Bootstrap"],
  "Cloud & DevOps": ["AWS (EC2, Lambda, RDS)", "Docker", "GitHub Actions"],
  "Databases": ["MySQL", "MongoDB", "PostgreSQL"],
  "Tools & Platforms": ["Git", "Postman", "VS Code", "Figma"],
  "AI/ML & Data": ["Pandas", "NumPy", "Scikit-learn", "TensorFlow", "OpenAI API", "LangChain"]
};

const Skills = () => {
  return (
    <section className="skills-section">
      <h2 className="section-title">My Skills</h2>
      <p className="section-subtitle">Here are some of the technologies I've worked with:</p>

      <div className="skills-grid">
        {Object.entries(skillCategories).map(([category, skills]) => (
          <div className="skills-category" key={category}>
            <h3>{category}</h3>
            <ul>
              {skills.map(skill => (
                <li key={skill}>{skill}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
